import React from "react";

import classes from "./Tachas.module.css";

const Tachas = () => {
  const opciones = props.tachas.map((tacha, i) => (
    <details className={classes.details}>
      <summary>{tacha.tipo}</summary>
      <form>
        <label>
          1.OXIDO <input type="checkbox" value="OXIDO"/>
        </label>
        <label>
          2.PELTRE <input type="checkbox" value="PELTRE" />
        </label>
        <label>
          3.PLATEADAS <input type="checkbox" value="PLATEADAS"/>
        </label>
        <label>precio: ${tacha.precio.tofixed(2)}</label>
      </form>
    </details>
  ));
  return (
    <div className={classes.Tachas}>
      <h2>Tachas</h2>
      <div></div>
    </div>
  );
};

export default Tachas;
